import{_ as e,c as t,o,aM as s}from"./chunks/framework.DAyGILei.js";const m=JSON.parse('{"title":"Stata","description":"Installation guide for Stata.","frontmatter":{"title":"Stata","category":"Analytical tools","permalink":"/do-science/tools/analytical/stata","outline":1,"description":"Installation guide for Stata."},"headers":[],"relativePath":"do-science/tools/analytical/stata.md","filePath":"do-science/tools/analytical/stata.md"}'),i={name:"do-science/tools/analytical/stata.md"};function n(r,a,l,c,h,u){return o(),t("div",null,[...a[0]||(a[0]=[s('<h1 id="stata" tabindex="-1">Stata <a class="header-anchor" href="#stata" aria-label="Permalink to &quot;Stata&quot;">​</a></h1><p><strong><a href="https://www.stata.com/" target="_blank" rel="noreferrer">Stata</a> is a ananlytical software developed by StataCorp tailored towards epidemiological analysis.</strong></p><nav class="table-of-contents"><ul><li><a href="#installation-in-hunt-workbench">Installation in HUNT Workbench</a></li><li><a href="#installation-on-home-machines">Installation on home machines</a></li><li><a href="#running-stata-over-x2go">Running Stata over X2Go</a></li><li><a href="#troubleshooting">Troubleshooting</a></li></ul></nav><div class="warning custom-block"><p class="custom-block-title">Requirement</p><ul><li>Access to a Stata license for the lab users in your lab.</li></ul></div><h2 id="installation-in-hunt-workbench" tabindex="-1">Installation in HUNT Workbench <a class="header-anchor" href="#installation-in-hunt-workbench" aria-label="Permalink to &quot;Installation in HUNT Workbench&quot;">​</a></h2><p>You may request Stata in your HUNT Workbench as a Jupyter notebook. This means that you can write known Stata commands and that you can view plots on your screen. See our <a href="/do-science/guides/workbench-stata">Stata guide</a> for more details and request HUNT Workbench Stata access in our do-science <a href="/do-science/service-desk/#general-service-request">service desk</a>.</p><h2 id="installation-on-home-machines" tabindex="-1">Installation on home machines <a class="header-anchor" href="#installation-on-home-machines" aria-label="Permalink to &quot;Installation on home machines&quot;">​</a></h2><p><a href="/contact">Contact us</a> for assistance on installations on your <a href="/do-science/faq/compute#machine-types">home machine</a> and discussions on licenses types tailored for your lab work.</p><div class="tip custom-block"><p class="custom-block-title">NTNU license</p><p>All NTNU employees are covered by the NTNU license which allow for quick installations. Lab users that are not affiliated with NTNU will need to either bring their own license or ask their lab leader to buy a license from StataCorp.</p></div><h2 id="running-stata-over-x2go" tabindex="-1">Running Stata over X2Go <a class="header-anchor" href="#running-stata-over-x2go" aria-label="Permalink to &quot;Running Stata over X2Go&quot;">​</a></h2><p>After our installation, you can access Stata over <a href="/do-science/tools/technical/x2go">X2Go</a> with this <strong><code>Single application</code></strong> address in the X2Go configuration (or similar provided by us):</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">/usr/bin/xterm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -e</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> /mnt/work/software/stata170/xstata-mp</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -f0</span></span></code></pre></div><p>Or you can run as terminal application:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">/mnt/work/software/stata170/stata-mp</span></span></code></pre></div><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><h4 id="the-icons-appear-as-question-marks" tabindex="-1">The icons appear as question marks <a class="header-anchor" href="#the-icons-appear-as-question-marks" aria-label="Permalink to &quot;The icons appear as question marks&quot;">​</a></h4><p>There is a <a href="https://www.statalist.org/forums/filedata/fetch?id=1351289&amp;d=1469795531&amp;type=full" target="_blank" rel="noreferrer">known issue</a> in Stata on Linux that may render icons as question marks. We have implemented work arounds that should mitigate this issues for installations that we support. <a href="/contact">Contact us</a> if you still experience this so we can have a look and update your configuration.</p><h4 id="my-file-consume-all-of-the-machine-memory" tabindex="-1">My file consume all of the machine memory <a class="header-anchor" href="#my-file-consume-all-of-the-machine-memory" aria-label="Permalink to &quot;My file consume all of the machine memory&quot;">​</a></h4><p>You might need to consider the memory consumption of Stata when you work with files close to your machine memory. <a href="/do-science/faq/compute#is-my-process-hitting-memory-issues">Click here</a> to learn how to assess if you are hitting memory issues on your machines. If so, the University of Wisconsin has written up a guide on <a href="https://www.ssc.wisc.edu/sscc/pubs/stata_memory.htm" target="_blank" rel="noreferrer">how to reduce Stata&#39;s memory consumption</a>. <a href="/contact">Contact us</a> for a memory upgrade if necessary.</p>',19)])])}const p=e(i,[["render",n]]);export{m as __pageData,p as default};
